D ['classes'] ['21'] ['public_methods'] ['members'] ['2'] ['detailed'] ['doc'] ['2'] ['content'] =  "desc onReceive with did Managers created with TIDL can broadcast messages to other managers and apps. When a specific event occurs in the Manager made with TIDL, if a manager wants to receive the event from the TIDL Manager, manager can register events of interest to TIDL Manager with the registerreceiver function. Then, when the event occurs, a specific event is delivered to the requested Manager through broadcast. For example, if you want to know when the car has started, register the event through the registerreceiver function, and the car has started. An event indicating that startup has occurred will be delivered to the manager who created the RegisterReceiver request."
